						l_subject_firstname,
						l_subject_lastname,
						l_dob,
						l_subject_email,
						l_subject_hash, 
						l_subject_telephone,
						'',
						l_gp_option,
						l_email_option, 
						1,
						l_subject_id,
						l_status_active, 
						unix_timestamp(),
						1 

					);
			END IF; 
		UNTIL no_rows
				
	END REPEAT subject_loop; 
	CLOSE subject_csr; 

	
	
	
	
END ;;
